import React from 'react';

function Pontuacao() {
  return (
    <div style={{maxWidth:900,margin:'40px auto',background:'#fff',borderRadius:16,boxShadow:'0 2px 12px #0002',padding:32}}>
      <h2 style={{textAlign:'center',color:'#2d3a4b',marginBottom:24}}>Pontuação</h2>
      <div style={{textAlign:'center',color:'#2d3a4b',fontSize:'1.2rem'}}>Área de pontuação para admin e gerente (em breve)</div>
    </div>
  );
}

export default Pontuacao;
